description:
Register zdravil Mediately vam pomaga do takojšnjih podatkov o zdravilih, kod MKB in drugih medicinskih vsebin, da lahko več časa posvetite svojim pacientom.
Prav tako poenostavlja kompleksno medicinsko vsebino in vam pomaga pri sprejemanju informiranih odločitev. Tudi brez internetne povezave lahko enostavno in hitro iščete po registru zdravil, ki vsebuje informacije o več kot 11.000 zdravilih. Prav tako imate takojšen dostop do interaktivnih kliničnih orodij in kalkulatorjev odmerjanja. 

Namestite aplikacijo in že lahko:

1. Pridobite informacij o več kot 11.000 zdravilih. Za vsako zdravilo so na voljo podrobne informacije, med njimi:

• osnovne informacije o zdravilu (učinkovina, sestava, farmacevtska oblika, razred, razvrstitev zdravil na liste ZZZS);
• pomembne informacije iz povzetka glavnih značilnosti zdravila (indikacije, odmerjanje, kontraindikacije, interakcije, neželeni učinki, preveliko odmerjanje ipd.);
• klasifikacija ATC in vzporedna zdravila;
• pakiranja in cene;
• dostop do celotnega povzetka glavnih značilnosti zdravila v PDF-obliki (potrebna je internetna povezava).

2. Prilagodite bolnikova zdravila, da ne povzročajo pomembnih interakcij

Nova rešitev kot prva na trgu omogoča, da lahko zdravilo, ki povzroča problematične interakcije zamenjate z zdravili, ki imajo manj interakcij ali manj resne interakcije - v zgolj nekaj sekundah. Uporabite seznam predlaganih alternativ ali ročno preverite izbrano zdravilo. 

3. Pridobite hitre informacije o omejitvah uporabe zdravil

Prihranite čas s predogledom omejitev uporabe zdravil pri ledvični in jetrni okvari, dojenju ter nosečnosti.

4. Olajšajte si iskanje po poglavju o odmerjanju

Skozi poglavje o odmerjanju se pomikajte z bližnjicami za ledvično in jetrno okvaro, starejšo in pediatrično populacijo ter način uporabe.

5. Iščete po širokem naboru interaktivnih diagnostičnih orodij

Aplikacija poleg celotne baze zdravil vsebuje vrsto interaktivnih kliničnih orodij in kalkulatorjev odmerjanja, uporabnih za vašo vsakdanjo prakso:

• BMI (indeks telesne mase);
• BSA (telesna površina);
• CHA₂DS₂-VASc (rezultat tveganja za možgansko kap pri atrijski fibrilaciji);
• GCS (Glasgowska lestvica kome);
• GFR (formula MDRD);
• HAS-BLED (tveganje za večjo krvavitev pri bolnikih z AF);
• MELD (model za končno ledvično odpoved);
• PERC Score (izključitvena merila za pljučno embolijo);
• Wellsova merila za pljučno embolijo.

Poiščite orodja, ki jih vsak dan uporablja na tisoče zdravnikov. 

3. CME (Izobraževanja)

Izboljšajte svoje znanje in pridobite kreditne točke CME iz udobja lastnega doma ali ordinacije.

• Preberite članek ali si oglejte videoposnetek, ki vas zanima.
• Tematike se stalno posodabljajo in vam omogočajo koristne vpoglede v vaše strokovno področje.

Aplikacija vključuje tudi razvrstitev bolezni po MKB-10 in klasifikacijski sistem ATC. Aplikacijo redno posodabljamo, zato boste imeli vedno na voljo najnovejše informacije.

Upoštevajte: deli te aplikacije so namenjeni zdravstvenim delavcem kot orodje za pomoč pri odločanju. Aplikacija ni zasnovana za bolnike in ne nadomešča nasveta zdravnika.

Pogoji uporabe: https://www.apple.com/legal/internet-services/itunes/dev/stdeula/
